Nacho is a notorious criminal who's a hired gun for other criminals. What he doesn't know is that Diana; his supposed girlfriend. Is actually an undercover FBI agent looking to take Nacho down. Nacho gets arrested, and Diana has collected enough evidence on Nacho to put him away for life. Nacho has no choice but to become a rat-snitch for the FBI. Nacho is furious that the girl he loved is the one who set him up. So now he's going to dish out the appropriate punishment.
